import * as Types from '../../action_types/search_violation'
export function showInfowindow(item){

    return{
        type:Types.SHOW_INFOWINDOW_VIOLATION,
        payload:item
    }
}
export function clearInfowindow(){

    return{
        type:Types.CLEAR_INFOWINDOW_VIOLATION,
    }
}
export function getSearchViolationRequest(){
    return{
        type:Types.SEARCH_VIOLATION.GET_SEARCH_VIOLATION_REQUEST
    }
}
export function getSearchViolationSuccess(data){
    return{
        type:Types.SEARCH_VIOLATION.GET_SEARCH_VIOLATION_SUCCESS,
        payload:data
    }
}
export function getSearchViolationFailure(err){
    return{
        type:Types.SEARCH_VIOLATION.GET_SEARCH_VIOLATION_FAILURE,
        err
    }
}
